import React from "react";
import logo from "./logo.svg";
import "./App.css";
import Header from "./Components/Header";
import Content from "./Components/Content";
import Story from "./Components/Story/Story";
import Footer from "./Components/Footer";

function App() {
  return (
    <div>
      <Header />
      <Content />
      <Story />
      <Footer />
    </div>
  );
}

export default App;
